import React from "react";
import { BrowserRouter, Routes } from "react-router-dom";
import Layout from "../src/components/layout/Layout";

const Router = () => {
  return (
    <BrowserRouter>
      <Layout>
        <Routes></Routes>
      </Layout>
    </BrowserRouter>
  );
};

export default Router;
